-----------------------------------------------------
-- PURPOSE
	-- get the performance of slow payers before and during the call
	-- the query counts the number of days the customer was on march and april
	-- division of the days on and days active give the utilization rate.
	-- also getting the payments also give us the value in terms of cash from the slow payers

------------------------------------------
-- get customer details and the number of days on in april
with customer_details as
(
	select 
		distinct dcs.payg_account_id ,
		dcs.account_id ,
		sum
		(
			case 
				when dcs.payment_status ilike 'normal'
					then 1
				else 0
			end
		) as days_on_april ,
		sum
		(
			case 
				when dcs.customer_status ilike 'active'
					then 1
				else 0
			end
		)as days_active_april	,
		max(dcs.daily_rate) as current_daily_rate
	from kenya.daily_customer_snapshot dcs 
	where 
		dcs.date_timestamp::DATE between '20240402' and '20240501'
		and dcs.payg_account_id in 
