----------------------------------------------------------------
-- get customer details and the number of days on in march
customer_details_march as
(
	select 
		distinct dcs.payg_account_id ,
		dcs.account_id ,
		sum
		(
			case 
				when dcs.payment_status ilike 'normal'
					then 1
				else 0
			end
		) as days_on_march ,
		sum
		(
			case 
				when dcs.customer_status ilike 'active'
					then 1
				else 0
			end
		)as days_active_march	,
		max(dcs.daily_rate) as current_daily_rate
	from kenya.daily_customer_snapshot dcs 
	where 
		dcs.date_timestamp::DATE between '20240302' and '20240401'
		and dcs.payg_account_id in 
