-------------------------------------------------------
-- get the sum of payment in march
march_payments as 
(
	select 
		p.account_id ,
		sum(p.amount) as amount_paid_march
	from kenya.payment p 
	right join customer_details dcs 
		on dcs.account_id = p.account_id
	where 
		p.payment_utc_timestamp::DATE between '20240301' and '20240331'
		and p.reconciliation_status ilike 'matched'
		and p.processing_status ilike 'posted'
		and p.is_void = false 
		and p.third_party_payment_ref_id not like 'BONUS%'
	group by 1
),

-----------------------------------------------------------
-- get the sum of payment in april
april_payments as 
(
	select 
		p.account_id ,
		sum(p.amount) as amount_paid_april
	from kenya.payment p 
	right join customer_details dcs 
		on dcs.account_id = p.account_id
	where 
		p.payment_utc_timestamp::DATE between '20240401' and '20240430'
		and p.reconciliation_status ilike 'matched'
		and p.processing_status ilike 'posted'
		and p.is_void = false 
		and p.third_party_payment_ref_id not like 'BONUS%'
	group by 1
)

----------------------------------------------
-- main query that brings everything together
select 
	dcs.*,
	cm.days_on_march,
	cm.days_active_march,
	am.amount_paid_march ,
	ap.amount_paid_april
from customer_details dcs
left join march_payments am 
	on am.account_id = dcs.account_id
left join april_payments ap 
	on ap.account_id = dcs.account_id
left join customer_details_march cm
	on cm.account_id = dcs.account_id